				"<p><br />Das Angebot von somnio ist in zwei Teilen gegliedert: Einerseits ein sch&ouml;nes Sortiment an stilvollen Geschenken, Floristik und florale Kombinationen und andererseits ein Kursprogramm beinhaltend florale Gestaltungskurse, die in einer kreativen Atmosph&auml;re stattfinden. Haben wir&nbsp;Sie &laquo;gwundrig&raquo; gemacht? Dann lesen Sie weiter...<br /><br /><b>Kursangebot</b><br /><br />Hier treffen Inspiration, Kreativit&auml;t und Freude am Gestalten und Experimentieren aufeinander. Jedermann/-frau ist ein Gestalter. Nur Mut! Ob selbstst&auml;ndig oder unter Anleitung gelingt es Ihnen mit oder auch ohne Vorkenntnisse ein tolles Werk zum jeweiligen Thema herzustellen. Lassen Sie den stressigen Alltag hinter sich und tauchen Sie mit allen Sinnen in die Welt der Kreativit&auml;t ein. Das&nbsp;Angebot&nbsp;dreht sich um die Floristik, die unz&auml;hlige M&ouml;glichkeiten zu jeder Saison bietet.</p><p>Das Kursprogramm finden Sie unter &laquo;Kurskalender&raquo; auf unserer Homepage www.somnio.ch&;nbsp;oder fragen Sie direkt bei uns&nbsp;im Gesch&auml;ft nach. Wir freuen uns auf Sie und das gemeinsame Erlebnis!<br /><br />W&uuml;nschen Sie ein gemeinsames, kreatives Erlebnis mit Freunden, Familie oder Arbeitskollegen? Gruppen haben die M&ouml;glichkeit ausserhalb der offiziellen Kursdaten mit meiner Unterst&uuml;tzung ein Werk zu einem individuell gew&auml;hlten Thema entstehen zu lassen. Ein Riesenspass! Nehmen Sie mit uns Kontakt auf!<br /><br /><b>Angebot</b><br /><br />Suchen Sie spezielle, stilvolle und abwechslungsreiche Geschenke und Dekorationen? Dann sind Sie bei somnio genau richtig. Das Geschenkartikelsortiment ist sorgf&auml;ltig ausgesucht und beinhaltet nebst haltbarer Floristik auch Frischblumen und Geschenkartikel.&nbsp;</p><p>Durch die Verwendung und Kombinationen von Materialien, die gr&ouml;sstenteils aus der Natur entspringen, entsteht eine grosse Vielfalt an M&ouml;glichkeiten.<br /><br />Folgende Artikel sind Bestandteil des Sortiments:</p><p>&nbsp;</p><ul><li>Florales: Schnittblumen, haltbare Floristik, Topfpflanzen</li><li>Geschenke: Glas, Keramik, Kerzen, Liechtli und viiiiielen anderen&nbsp; &laquo;Krimskrams&raquo;den man gerne verschenkt</li><li>Geschenke aus dem Lebensmittelbereich: div. Schokolade, Sirup (Sirupier de berne), Tee...</li><li>sch&ouml;nes Kartensortiment von lebendig und fotoeigenart</li><li>somnio Gutscheine, einl&ouml;sbar auf das gesamte Sortiment inkl. Kurse</li></ul><p>Sie sind eine kreative Pers&ouml;nlichkeit und w&uuml;nschen Verbrauchsmaterial, um ein Werk zu Hause entstehen zu lassen? Ob technische Hilfsmittel oder Dekoartikel: bei somnio ist alles kaufbar...</p><p>&nbsp;</p><p><b>Dienstleistungen auf Bestellung</b></p><p>&nbsp;</p><ul><li>individuelle Geschenke</li><li>Dekorationen f&uuml;r Anl&auml;sse</li><li>Hochzeitsfloristik</li><li>Trauerfloristik</li><li>Dauerauftr&auml;ge f&uuml;r Ihr B&uuml;ro, den Empfangsbereich oder als regelm&auml;ssige &Uuml;berraschung f&uuml;r Privatpersonen...</li><li>Hauslieferdienst</li></ul><p>&nbsp;<br />&nbsp;</p>",
