			context: "general",
			title: "Strickler Blumen & Gärten AG",
			subtitle: "Dorfstrasse 66, 8805 Richterswil",
			description:
				'<p><b>Gartenbau und Blumen in Richterswil</b></p><p>Jahrelange Erfahrungen, Rund um den Gartenbau. Und nat&uuml;rlich unsere geliebten Blumen nicht zu vergessen.<br /><br />Wir freuen uns, Ihnen neue Tipps und Tricks zu verraten, kommen Sie vorbei oder rufen Sie an.<br /><br />In der Zwischenzeit erreichen Sie uns wie immer telefonisch unter 043 888 10 10 und per Telefax unter 043 888 10 15. F&uuml;r Blumenbestellungen steht Ihnen unser Floristinnen-Team unter der Telefonnummer 043 888 10 00 gerne zur Verf&uuml;gung. Nat&uuml;rlich freuen wir uns auch &uuml;ber eine E-Mail von Ihnen, die Sie an diese Adresse senden k&ouml;nnen:<br /><a href="mailto:info@strickler-gartenbau.ch">info@strickler-gartenbau.ch</a><br /><br />Wenn Sie unser Unternehmen noch gar nicht kennen, und erst im Internet von uns erfahren haben: Wir w&uuml;rden uns freuen, von Ihnen zu h&ouml;ren! Bitte lassen Sie uns Ihre W&uuml;nsche und Fragen wissen, gerne beraten wir Sie ausf&uuml;hrlich.<br /><br />In aller K&uuml;rze sollten Sie folgendes &uuml;ber uns wissen: Unser Unternehmen steht seit mehr als 50 Jahren f&uuml;r herausragende Leistungen auf dem Gebiet des Gartenbaus sowie unsere Spezialit&auml;ten Schwimmteiche, Biotope und Z&auml;une. Auch f&uuml;hren wir seit Jahren unseren erfolgreichen Blumenladen annex Pflanzencenter (eigene Parkpl&auml;tze vorhanden) an der Dorfstrasse 66 in Richterswil, wo sich auch unsere Gesch&auml;ftsr&auml;ume befinden.<br /><br />Unser Laden ist liebevoll und mit k&uuml;nstlerischem Flair, das ein einmaliges Ambiente schafft, eingerichtet. Die Vielfalt und Kreativit&auml;t von Str&auml;ussen und Arrangements in diversen Farbt&ouml;nen wird Sie begeistern.<br /><br />Unser Pflanzencenter bietet Ihnen alles zur Versch&ouml;nerung und Begr&uuml;nung Ihrer Innen- und Aussenr&auml;ume.<br />&nbsp;</p>',
