			title: "SWIZZ GREEN",
			subtitle: "Stadthausstrasse 133, 8400 Winterthur",
			description:
				"<p><b>Willkommen beim SWIZZ GREEN Blumengeschäft</b></p><p><!--StartFragment--><!--StartFragment--></p><p>Alles aus Freude am Sch&ouml;nen.</p><p>In der kreativen Umsetzung von Kundenw&uuml;nschen geh&ouml;ren wir zu den f&uuml;hrenden Gesch&auml;ften im regionalen und &uuml;berregionalen Bereich.</p><p>Wir stellen h&ouml;chste Anspr&uuml;che an die Qualit&auml;t unserer Produkte und setzen mit unseren Kreationen und Ideen Massst&auml;be im floristischen Bereich.</p><p>In unserem Kundenservice sowie der Freundlichkeit und Aufgeschlossenheit gegen&uuml;ber unserer Kunden, lassen wir uns von keinem &uuml;berbieten.</p><p>Unser Ziel ist es, in jeder Hinsicht Aussergew&ouml;hnliches zu realisieren. Daf&uuml;r stehen wir mit unserem Namen SWIZZ GREEN | by Gretener.</p><p>Unser Mitarbeiterteam ist stolz darauf diesen hohen Massst&auml;ben zu entsprechen. Wir arbeiten gewinnorientiert und sind dadurch in der Lage f&uuml;r unsere Kunden stets die besten Qualit&auml;ten und ein innovatives Warensortiment zu realisieren. Wir sichern damit auch die Existenz unserer Mitarbeiter.</p><p>Der Kunde steht bei uns immer im Mittelpunkt. Sein Anspruch ist f&uuml;r uns h&ouml;chster Ansporn. Wir freuen uns mit Blumen und Pflanzen zu arbeiten. Ein L&auml;cheln geh&ouml;rt f&uuml;r uns zu unserer Arbeit.<br />&nbsp;</p><p><!--EndFragment--></p><p><!--EndFragment--><!--EndFragment--></p>",
