			description:
				'<p>Depuis 20 ans nous enrichissons notre savoir faire en alliant services, ventes et &eacute;v&eacute;nements.</p><p><b>Particuliers</b></p><p>Notre boutique propose des <b>compositions florales</b> pour toutes les occasions. En fonction de vos demandes, nous r&eacute;alisons des arrangements de fleurs de saison aux couleurs de votre choix.</p><p>Nous veillons &agrave; travailler les fleurs avec d&eacute;licatesse et originalit&eacute;, afin de faire ressortir l&#39;&eacute;l&eacute;gance et la fra&icirc;cheur de chacune pour:</p><ul><li>Les anniversaires,</li><li>Les mariages,</li><li>Les deuils et enterrements,</li><li>Les c&eacute;r&eacute;monies diverses,</li><li>... les envies de faire plaisir.</li></ul><p><b>Entreprises</b></p><p>Venetoulis propose diff&eacute;rents services particuli&egrave;rement adapt&eacute;s aux <b>entreprises</b>.<br />Vous souhaitez que vos locaux soient fleuris en tous temps? Nous composons et livrons des <b>arrangements floraux</b> aussi souvent que vous le d&eacute;sirez. En fonction des saisons, nous proposons des compositions de couleurs diff&eacute;rentes, dans des supports variables.</p><p>Si vous organisez un &eacute;v&egrave;nement particulier et que vous souhaitez apporter une touche d&#39;&eacute;l&eacute;gance &agrave; celui-ci, nous pourrons &eacute;galement vous proposer nos services de fleuriste. Nous nous adapterons &agrave; votre budget, vos envies et &agrave; la tonalit&eacute; de l&#39;occasion.</p><p>Nous sommes &eacute;galement en mesure de prendre en charge la totalit&eacute; de l&#39;organisation de vos &eacute;v&eacute;nements et de g&eacute;rer les relations entre les diff&eacute;rents partenaires. Gr&acirc;ce &agrave; notre exp&eacute;rience dans ce domaine, nous pouvons compter parmi nos clients des entreprises renomm&eacute;es nationales et internationales.</p><p><b>Livraison</b></p><p>Nous&nbsp;<b>livrons </b>nos arrangements et nos bouquets<b> dans toute la ville de Gen&egrave;ve</b> et ailleurs en <b>Suisse</b>. En fonction de vos demandes, nous d&eacute;finissons avec vous le moment et le lieu o&ugrave; vous souhaitez faire livrer les fleurs.</p><p><a href="https://www.venetoulis-fleurs.ch/nous-contacter";>Pour plus d&#39;informations quant aux tarifs de livraison, contactez-nous</a>.</p><p><!--EndFragment--></p>',
