			web_permalink:
				"https://www.local.ch/en/d/russikon/8332/horticulture-and-garden-maintenance/waffenschmidt-ag-o5cgv5jmDl3aW60C2SJaHQ",
			context: "general",
			title: "Waffenschmidt AG",
			subtitle: "Im Berg 10, 8332 Russikon",
			description:
				'<p><b>Herzlich Willkommen in Ihrem H.Waffenschmidt</b></p><p><b>Herzlich Willkommen in Ihrem H.Waffenschmidt (Gartencenter / Gartenbau / Blumengesch&auml;ft)</b></p><p><i><b>Gartencenter:</b></i></p><p><b>Wechselflor: </b><br />Als Spezialisten f&uuml;r Terrasseng&auml;rten bieten wir Ihnen das breiteste Balkonpflanzensortiment unserer Region aus eigener Produktion. Unsere kreativen G&auml;rtnerinnen und G&auml;rtner stellen Ihnen gerne individuelle Bepflanzungsvorschl&auml;ge zusammen. Lassen Sie sich von unserem vielseitigen Wechselflor-Angebot inspirieren.</p><p><b>Stauden &amp; Geh&ouml;lze:</b><br />Als Spezialisten f&uuml;r Terrasseng&auml;rten bieten wir Ihnen das breiteste Balkonpflanzensortiment unserer Region aus eigener Produktion. Unsere kreativen G&auml;rtnerinnen und G&auml;rtner stellen Ihnen gerne individuelle Bepflanzungsvorschl&auml;ge zusammen. Lassen Sie sich von unserem vielseitigen Wechselflor-Angebot inspirieren.</p><p><b>Innenbegr&uuml;nung:</b><br />W&auml;hrend dem ganzen Jahr finden Sie bei uns Gr&uuml;npflanzen, Sukkulenten, Rarit&auml;ten, wie auch hochwertige Gef&auml;sse f&uuml;r den Innenbereich.</p><p><b>Bonsai:</b><br />Kunstvoll gestaltete B&auml;ume in der Schale werden von geschulten Fachg&auml;rtnerinnen und Fachg&auml;rtner gehegt und gepflegt. Ein umfangreiches Angebot an Freiland- und Zimmerbonsai, Fachliteratur und das n&ouml;tige Zubeh&ouml;r haben wir f&uuml;r Sie zusammengestellt.</p><p><b>Advent:</b><br />In der Adventszeit bieten wir Ihnen verschiedenste Weihnachtssterne, ein breites Angebot von Weihnachtsschmuck, Kerzen, Adventsbinderei und vielem mehr.</p><p>&nbsp;</p><p><i><b>Gartenbau:</b></i><br /><br /><b>Planung&amp;Architektur:</b><br />Unsere St&auml;rke ist es, die individuellen W&uuml;nsche, Bed&uuml;rfnisse, Situationen und bestehenden Gegebenheiten mit unseren Ideen in einen kreativen Planvorschlag umzusetzen.<br /><br />Gartenbau / Gartenpflege / Terassen&amp;Fassaden / Friedhof<br /><br /><br /><i><b>Blumengesch&auml;ft:</b></i><br /><br /><b>Blumenbinderei:</b><br />Unser Fachpersonal verarbeitet f&uuml;r Sie frische Schnittblumen und stellt Floristikkunst nach Ihren Bed&uuml;rfnissen her.</p><p><b>Hochzeit:</b><br />Der passende Brautstrauss, Kirchendekoration, sowie Fahrzeugschmuck bis hin zur Blumendekoration im Restaurant fertigen wir gerne nach Ihren W&uuml;nschen f&uuml;r Ihren grossen Tag an.</p><p><b>Trauer:</b><br />Unsere Floristikabteilung fertigt f&uuml;r Sie liebevoll Kr&auml;nze, Sargbouquet, Urnenschmuck, Kirchendekoration, Gestecke und Grabschmuck an.</p><p><b>Bestellung:</b><br />Bei Interesse d&uuml;rfen Sie hier &uuml;ber diesen Link direkt Bestellen:<br /><a href="http://waffenschmidt.ch/floristik/bestellung/";>http://waffenschmidt.ch/floristik/bestellung/<;/a></p><p>Weitere Infos finden Sie auf unserer Webseite (oben ersichtlich).<br />&nbsp;</p><p>Wir freuen uns auf Sie!</p><p>&nbsp;</p><p>&nbsp;</p>',
