			description:
				"<p><b>Seit 5 Generationen durch die Familie geleitet.</b></p><br>          Inhaber/Geschäftsführer: <br /><ul><li>Serge van Egmond </li><li>Jan van Egmond-Weber </li><li>Silvia van Egmond-Weber</li></ul>Unsere Prinzipien<br /><ul><li>Frische und Qualität </li><li>Zuverlässigkeit und Pünktlichkeit </li><li>Exakte Vorkalkulation bei grösseren Aufträgen </li><li>Hilfe in dringenden Fällen </li><li>Erreichbarkeit – praktisch zu jeder Zeit </li></ul>Unser «blumiges» Angebot <br /><ul><li>Schnittblumen der Saison </li><li>Rosen </li><li>Orchideen usw. </li><li>als Sträusse </li><li>oder als geschmackvolle Arrangements zusammengestellt </li></ul>Unser «pflanzliches» Angebot <br />Pflanzen aller Art für: <br /><ul><li>Wohnzimmer </li><li>Wintergärten </li><li>Gärten </li><li>Terrassen und Balkone </li><li>Büros oder Empfangsräume </li><li>Ausstellungsräume </li><li>Konferenzräume </li><li>... und mehr! </li></ul><p />Unser «dekoratives» Angebot <br />Dekorationen für jeden Anlass <br /><ul><li>Geburtstage </li><li>Hochzeitsfeiern </li><li>Festessen </li><li>Jubiläen </li><li>Tagungen/Kongresse </li><li>Generalversammlungen </li><li>Ausstellungen </li><li>Trauerfeiern </li><li>Messe/Sportveranstaltungen </li></ul><p />Fleurop-Service <br />Mit Fleurop vermitteln wir Ihnen Ihre Blumen-Wünsche und -Grüsse in die ganze Welt! Innerhalb der Schweiz innert Minuten und ins Ausland innert Stunden. <br />Ob Kalkutta, Sydney oder Rom, wo die Blumen hingeliefert werden sollen bestimmen Sie. <br /><br />Unser «Mehr»-Angebot<br /><ul><li>Individuelle Beratung - mehr als verkaufen </li><li>Sonderleistungen für spezielle Kundenwünsche </li><li>Anregungen und Ideen, damit Blumen und Pflanzen mehr Freude bereiten </li><li>Lieferung nach Hause, in die Firma oder an Verwandte / Freunde </li><li>Speziell abgestimmte Liefertermine bei grösseren Veranstaltungen oder bei Dauer-Aufträgen </li><li>Auf- und Abbau von Dekorationen </li><li>Bereitstellung von Deko-Mitteln wie Vasen, Töpfen, Ständern usw. </li></ul><p />Wir machen Ihnen einen Vorschlag ! <br />Stellen Sie uns auf die Probe. Prüfen Sie unsere Leistungsfähigkeit und fordern Sie unsere Kreativität. Geben Sie uns einen ersten Auftrag – am besten gleich jetzt <br /></br>",
