				"<p><!--StartFragment-->Im Jahre 1984 wurde eine gr&uuml;ndliche Sanierung der G&auml;rtnerei vorgenommen. Zus&auml;tzlich baute man den Blumenladen und weitere Gew&auml;chsh&auml;user. Die Wiedmer Blumen AG wurde Mitglied der Blumenb&ouml;rse Bern. Da der Besitzer, Herr Fred Wiedmer, nebenamtlich noch als Lehrer an der Gewerbeschule in Lyss t&auml;tig war, wurde Herr Josef Horber zum Betriebsleiter (Oberg&auml;rtner) bef&ouml;rdert. Herr Horber arbeitete seit 1972 bei der Wiedmer Blumen AG. 1997 &uuml;bergab Herr Wiedmer die Gesch&auml;ftsf&uuml;hrung an Herr Horber. Dieser wiederum &uuml;bergab die Gesch&auml;ftsf&uuml;hrung 2010 an Herr Daniel Riem, den heutigen Gesch&auml;ftsf&uuml;hrer.<!--EndFragment--></p><p><!--StartFragment--></p><p>Das Blumengesch&auml;ft beim Haupteingang des Inselspitals besteht seit dem Jahre 1995. Es wurde als Provisorium geplant, um den Bedarf eines Blumenfachgesch&auml;fts im Inselspital abzukl&auml;ren.&nbsp;</p><p>Seit Beginn wird das Gesch&auml;ft durch die Wiedmer Blumen AG in Aarberg betrieben.&nbsp; &nbsp;</p><p>Im 2010 wurde das Gesch&auml;ft durch das Inselspital von einem Provisorium in ein festes Gesch&auml;ft umgebaut.</p><p><!--EndFragment--></p>",
