			title: "Atelier Naturel",
			subtitle: "St. Germanstrasse 6, 3212 Gurmels",
			description:
				"<p><b>Der natürliche Blumenladen: Atelier Naturel in Gurmels</b></p><p>Das Atelier Naturel ist seit 1999 der Blumenladen f&uuml;r saisonale Blumen und Pflanzen in Gurmels - f&uuml;r drinnen und draussen. Ebenfalls zu unserem Angebot geh&ouml;rt die Trauerbinderei und der Grabschmuck.<br /><br />Wie es unser Name verr&auml;t, pflegen wir einen nat&uuml;rlichen Stil. Dies zeigt sich in unseren Dekorationen aber auch im t&auml;glichen Umgang mit unseren Kunden. Unser Team freut sich auf Ihren Besuch oder Anruf!</p><p><b>Blumen</b></p><ul><li>F&uuml;r drinnen und draussen</li><li>Ein grosses&nbsp;saisonales Angebot</li><li>Gestecke von traditionell &uuml;ber klassisch zeitlos bis ausgefallen</li></ul><p><b>Pflanzen</b></p><ul><li>F&uuml;r drinnen und draussen</li><li>Hydrokulturen f&uuml;r B&uuml;ros</li></ul><p><b>Accessoires</b></p><ul><li>F&uuml;r drinnen und draussen</li><li>Vasen und T&ouml;pfe aus Glas, Ton und Metall</li><li>Korbwaren</li><li>Windlichter</li><li>Laternen</li><li>Saisonale Dekorationen</li><li>und vieles mehr!</li></ul><p><br />Wir verwenden bevorzugt umweltschonende Pflanzenschutzmittel.<br />Wir beziehen die Produkte, wenn m&ouml;glich, von regionalen G&auml;rtnern oder Grossisten.</p><ul><li>Hochzeitsfloristik</li><li>Trauerbinderei</li><li>Accessoires f&uuml;r Haus und Garten</li><li>Pflanzen und Gef&auml;sse f&uuml;r Innen und Aussen</li><li>Hauslieferdienst</li></ul>",
