				"<p><b>Nos compositions Art Floral sur mesure</b></p><p><!--StartFragment-->Le magasin Fleurs Pour Tous &agrave; Bassecourt, vous pr&eacute;sente ses compositions florales originales et selon vos exigences. Nous vous proposons toutes sortes de bouquets (ronds, d&eacute;grad&eacute;s, traditionnels, asym&eacute;triques,..), d&#39;arrangements (piqu&eacute;s, de table, muraux, secs et en artificiels,..) de d&eacute;cors et autres compositions en tout genre. Nous pouvons &eacute;galement vous conseiller et vous accompagner pour vos &eacute;v&eacute;nements importants en faisant de chaque demande une composition unique et personnelle ( mariage, anniversaire, occasions en tout genre, communion, deuil, ....)<br /><br />Le magasin se trouve au centre gare de Bassecourt au bord de la route principale et &agrave; c&ocirc;t&eacute; de la gare, des places de parc sont r&eacute;serv&eacute;es pour nos clients .</p><ul><li><b>Nous faisons des livraisons &agrave; domicile ! Veuillez nous contacter au 032/426.75.10</b></li></ul><p><br />L&#39;&eacute;quipe de fleurs pour tous sera ravit de vous accueillir dans son magasin chaleureux. <!--EndFragment--></p>",
