				'<p><b>Au Panier Fleuri Sàrl</b></p><p>&nbsp;</p><p><a href="https://www.aupanierfleuri.ch/fr/#commande";>Commander en ligne ( cliquez ici )</a></p><p>Sandrine, Damien et leur &eacute;quipe vous souhaitent la bienvenue. Deuxi&egrave;me rel&egrave;ve de ce magasin datant de 1950, nous r&eacute;alisons des arrangements au gr&eacute; de vos envies et des tendances pour toutes les occasions. Fleuristes professionnels et passionn&eacute;s par notre m&eacute;tier, nous respectons lors de nos cr&eacute;ations les couleurs au fil des saisons et privil&eacute;gions les producteurs suisses. Nous effectuons les livraisons de fleurs dans la r&eacute;gion et sommes affili&eacute;s au service Fleurop Interflora pour les livraisons en Suisse et dans le monde. Nous nous r&eacute;jouissons de vous accueillir dans notre nouvel atelier.</p><p><a href="mailto:info@aupanierfleuri.ch.">info@aupanierfleuri.ch.</a></p><p>&nbsp;</p><p>&nbsp;</p><ul><li>sur facture</li><li>et nous acceptons toutes les cartes de cr&eacute;dit</li><li>fleuriste</li><li>livraison de fleurs</li></ul><p>&nbsp;</p><p>Des cr&eacute;ations uniques pour toutes les situations</p><ul><li><p>AU QUOTIDIEN</p><p>Tous nos bouquets et nos cr&eacute;ations florales sont r&eacute;alis&eacute;s par nos soins dans notre atelier au fil des saisons. Nous sommes &agrave; votre &eacute;coute pour vous conseiller et proposer&nbsp;un bouquet unique et qui vous ressemble.</p></li></ul><p>&nbsp;</p><ul><li>DEUILS ET HOMMAGES</li></ul><p>&nbsp;</p><p>Couronnes, coussins, gerbes, bouquets, compositions de plantes avec ou sans ruban, nous sommes l&agrave; pour vous guider dans votre choix. Nous effectuons les livraisons de fleurs &agrave; domicile, &agrave; l&rsquo;&eacute;glise, au fun&eacute;rarium et au cimeti&egrave;re.</p><p>&nbsp;</p><ul><li><p>MARIAGES</p><p>&nbsp;</p><p>De votre bouquet de mari&eacute;e, en passant par les boutonni&egrave;res, votre v&eacute;hicule, la d&eacute;coration de l&rsquo;&eacute;glise ainsi que du lieu des festivit&eacute;s. Nous cr&eacute;ons un d&eacute;cor sur mesure qui vous ressemble pour faire de ce jour un moment magique.</p></li></ul><p>&nbsp;</p>',
