			subtitle: "Hinterdorfstrasse 24, 9524 Zuzwil SG",
			description:
				"<p><b>Herzlich Wilkommen bei Ihrem Blumengeschäft</b></p><p><!--StartFragment--></p><p><i><b>Bluemewerkstatt aus &Uuml;berzeugung professionell</b></i><!--EndFragment--></p><p><!--StartFragment-->Blumen: Zur Gestaltung, gewachsene Bewegungen, bewusste Formen, Farbenspiel der Natur<br />Werkstatt: f&uuml;r Ideen, Tradition, Handwerk, klare Konzepte, im Laden, bei ihnen zu hause, Eventgestaltung in der ganzen Schweiz.<!--EndFragment--></p><p><!--StartFragment--></p><p>Produkte, Dienstleistungen</p><ul><li>Saisonstr&auml;usse</li><li>Hochzeitfloristik: die sch&ouml;nsten momente zur kr&ouml;nung einer innigen liebe mit blumigem glanz umrahmt. wir besitzen uneingeschr&auml;nkte m&ouml;glichkeiten, ihr grosses fest mit blumigem glanz zu gestalten.</li><li>Trauerfloristik: abschied, schmerz, fassungslosigkeit. Blumen spenden trost und hoffnung. Wir beraten sie gerne auch in schwierigen lebenslagen</li><li>Raumgestaltungen: der raum in dem man sich wohlf&uuml;hlt, w&auml;rme ausstrahlt, leuchtet und gl&auml;nzt voller blumenpracht. neuen glanz und zauber mit pflanzen und dekorationen, perfekt abgestimmt auf alle bed&uuml;rfnisse und w&uuml;nsche.</li><li>Kurse: in der bluemewerkstatt werden laufend aktuelle kurse angeboten</li><li>Hauslieferdienst</li><li>Gutscheine</li><li>Blumenabonnement f&uuml;r Geburtstage, Firmenjubil&auml;um etc</li></ul><p><br />Wir freuen uns auf Ihren Besuch</p><p><!--EndFragment--></p>",
