				"https://www.local.ch/en/d/dielsdorf/8157/florist/blumen-bethli-cafe-tuebli-W1WEo9hawu6y1gB4ui5gXw",
			context: "general",
			title: "Blumen Bethli / Café Tübli",
			subtitle: "Wehntalerstrasse 40b, 8157 Dielsdorf",
			description:
				"<p><b>Floristmeisterbetrieb seit 1977 / Blumenhaus mit Café Tübli</b></p><p>Blumenhaus mit Caf&eacute; T&uuml;bli: Lassen Sie sich verzaubern&nbsp; von unseren kreativen Ideen oder geniessen Sie Ihren Kaffe bei uns im T&uuml;bli.</p><p>Das Blumenhaus mit seinen R&auml;umen, angefangen vom Gew&ouml;lbekeller bis hoch zum Dachstock k&ouml;nnen Sie erkunden und besuchen. Auf der mittleren Etage befindet sich das Caf&eacute; T&uuml;bli. Ob Gesteck, Blumenstrauss, oder Geschenkartikel usw. finden Sie in unserem Haus.<br /><br />Je nach Saison und Mode finden Sie bei uns Blumen, Pflanzen zum Verschenken oder um sich selbst zu verw&ouml;hnen.<br /><br />Caf&eacute; T&uuml;bli: Das Cafe T&uuml;bli ist ein Geheimtipp der immer mehr entdecken. Im heimeligen Garten oder in der Stube bedienen wir Sie gerne. Vom Kaffee bis zum Wein oder Prosecco verw&ouml;hnen wir Sie. Auch Gruppen sind mit Vorank&uuml;ndigung herzlich Willkommen.<br /><br />Aktuelle Blumenkurse: www.blumenbethli.ch<;/p><p>Gerne Beraten wir Sie bei folgenden Arbeiten:</p><ul><li>Geburtstagsstr&auml;usse</li><li>Liebesgr&uuml;sse</li><li>Familienfeste</li><li>Jubil&auml;um</li><li>Genesungsgr&uuml;sse</li><li>Hochzeit</li><li>Tischdekoration</li><li>Ausstellung</li><li>Feste</li><li>Trauerfloristik</li><li>Blumenschmuck f&uuml;r den Empfang</li><li>Geschenke</li><li>Blumen-Abo</li><li>Gutscheine</li><li>Lieferservice</li><li>aussergew&ouml;hnliche Wohnaccessoires</li><li>Dekorationsartikel</li><li>M&auml;nnerpflanzen</li></ul><p>Blumen-Abo:<br />In gew&uuml;nschten Abst&auml;nden gestaltet Blumen Bethli einen abwechslungsreichen Blumenstrauss oder Blumengesteck und liefert diesen direkt an Ihre Wunschadresse.<br /><br />Trauer: leben/innehalten/erinnern/bewahren<br /><br />Erleben Sie einf&uuml;hlsamen, individuell gestalteter Grabschmuck mit viel Feingef&uuml;hl f&uuml;r Sie arrangiert<br /><br />Aus dem Leben:<br />Geburtstagstr&auml;usse Liebesgr&uuml;sse Familienfeste Jubil&auml;um Genesungsgr&uuml;sse Hochzeitsschmuck</p><p>Anl&auml;sse:<br />Tischdekorationen Ausstellungen Jubil&auml;umsfeier Geburtstagsfeste Trauerfloristik<br /><br />Firmen:<br />w&ouml;chentlicher Blumenschmuck f&uuml;r den Empfang Geschenke f&uuml;r Mitarbeiter Geschenke f&uuml;r Kunden Raumbegr&uuml;nung</p><p><b>NEU: </b>- Regelm&auml;ssige K&uuml;nstlerausstellungen in unserer Galerie, oberhalb des Blumengesch&auml;ftes.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Ebenfalls kann die Galerie gemietet werden.</p><p><br /><br />Wir freuen uns auf Ihren Besuch / Ihre Kontaktaufnahme.</p>",
