			subtitle: "Städtlistrasse 1, 7130 Ilanz",
			description:
				"<p>Individuelle Floristik</p><p>Suchen Sie etwas ganz Spezielles, etwas was genau zu Ihrem Bild &uuml;ber dem Sideboard passt oder perfekt auf den runden Tisch in dunklem Holz? W&uuml;nschen Sie sich ihre Blumen und Gestecke so individuell wie Sie selbst? Ich werde gerne ihre ganz pers&ouml;nlichen Blumenw&uuml;nsche erf&uuml;llen und auch nach Vorlagen oder Zeichnungen Ihre individuellen Vorstellungen umsetzen.</p><p>Festfloristik</p><p>Ein unvergesslicher Tag soll mit den sch&ouml;nsten Blumen dekoriert sein. Nicht nur Hochzeiten wollen mit sch&ouml;nen Blumen bestechen. Planen Sie ein Familienfest, eine Gesch&auml;ftsfeier oder einen Geburtstag? Gerne fertige ich die passende Dekoration an. Ich dekoriere f&uuml;r Sie auch den Festsaal in der Region. So k&ouml;nnen Sie sich auf die Organisation der Feier konzentrieren.</p><p>Trauerfloristik</p><p>Wenn ein geliebter Mensch aus dem Leben tritt, entsteht eine L&uuml;cke. In dieser schweren Zeit, berate ich Sie gerne in Sachen, Sargbouquet, Kr&auml;nze und diversen Trauerarrangements. Meine Blumen-kreationen sollen Ihnen w&auml;hrend dieser traurigen Zeit Trost spenden.</p><p>Grabbepflanzungen</p><p>Ich k&uuml;mmere mich auch um die Bepflanzung des Grabes ihrer Lieben. Gemeinsam mit Ihnen k&ouml;nnen wir Pflanzenarten und Stil der Bepflanzung aus-w&auml;hlen. F&uuml;r jede Jahreszeit eine individuelle Bepflanzung. Genau so wie Sie es sich w&uuml;nschen, kann ich es f&uuml;r Sie umsetzen.</p><p>Dauerauftr&auml;ge</p><p>M&ouml;chten Sie sich auf Ihr Hauptgesch&auml;ft konzentrieren, aber leider ist das Schaufensterschon wieder veraltet und entspricht nicht der neuen Jahreszeit? Kein Problem ich nehme Ihnen diese Aufgabe ab. Gerne dekoriere ich Ihnen als Dauerauftrag Ihr Schaufenster oder Ihre Hotellobby immer wieder neu.<br />Mit frischen Ideen und Ihrem Gesch&auml;ft angepasstem Flair soll ihre Dekoration den Raum bereichern und trotzdem nicht von Ihrem Hauptgesch&auml;ft ablenken. Auch wenn Sie Ihren Lieben jeden Monat Blumen senden m&ouml;chten, erledige ich dies f&uuml;r Sie mit Freude.</p><p><!--EndFragment--></p><p><!--EndFragment--></p><p><!--EndFragment--></p><p><!--EndFragment--></p><p><!--EndFragment--></p>",
