			description:
				"<p><b>Blumen Garten Spiez</b></p><p><!--StartFragment--></p><p><b>Informationen</b></p><p>Fr&uuml;hling<br /><br />Sobald keine Fr&ouml;ste mehr zu erwarten sind, werden wir in Ihrem Garten aktiv. Im Fr&uuml;hling erledigen wir f&uuml;r Sie folgende Arbeiten:<br /><br />Wir entfernen den Winterflor.<br />Wir bepflanzen die Wechselflorrabatte mit bl&uuml;henden Fr&uuml;hjahrsblumen.<br /><br />Wir bepflanzen Stauden- und Geh&ouml;lzrabatten.<br />Wir decken Ihre Rosen ab, schneiden und d&uuml;ngen sie.<br />Wir spritzen Ihre Obstb&auml;ume, Beerenstr&auml;ucher und Rosen.<br />Wir bearbeiten Ihren Rasen vom Nachs&auml;en &uuml;ber D&uuml;ngen, M&auml;hen bis zur Unkrautbek&auml;mpfung.<br /><br />Wir aerifzieren und vertikutieren Ihren Rasen (Moos-/Filz-Entfernung).<br /><br />Wir starten im Fr&uuml;hling mit der Rabattenpflege (Unkraut entfernen; lockern, d&uuml;ngen, R&uuml;ckschnitt von Gr&auml;sern und Stauden).<br /><br />Herbst<br /><br />W&auml;hrend den sch&ouml;nen Herbsttagen erledigen wir f&uuml;r Sie die saisongerechte Gartenpflege. In dieser Jahreszeit erledigen wir f&uuml;r Sie folgende Arbeiten:<br /><br />Wir entfernen f&uuml;r Sie das Laub.<br />Wir schneiden Ihre Rosen und bereiten sie f&uuml;r den Winter vor.<br />Wir schneiden die Bl&uuml;tenstauden zur&uuml;ck.<br />Wir verpflanzen die Stauden.<br />Wir pflanzen f&uuml;r Sie Rosenrabatten, Obstb&auml;ume, Hecken und Obstb&auml;ume</p><p>Produkte, Dienstleistungen</p><ul><li>Blumen</li><li>Bumenstrauss</li><li>Hochzeitsstrauss</li><li>Orchidee</li><li>Str&auml;usse</li><li>Valentinstag</li><li>Blumengesteck</li><li>Blumendeko</li><li>Deko</li><li>Innendeko</li></ul><p><!--EndFragment--></p>",
