			context: "general",
			title: "Blumen Habitus, Regula Elmer",
			subtitle: "Mitteldorf 5, 8460 Marthalen",
			description:
				'<p><b>Herzlich Willkommen</b></p><p><!--StartFragment--><!--StartFragment--><!--StartFragment--><!--StartFragment--><b>Blumen und Pflanzen</b></p><p>Menschen f&uuml;hlen sich mit Blumen und Pflanzen in ihrer Umgebung sicher wohler. In unserem Gesch&auml;ftsraum finden Sie eine Vielfalt an Speziellem. Wir lieben unseren Beruf und freuen uns, Sie zu beraten. Schauen Sie bei uns vorbei und betrachten Sie unsere kreative Arbeit <a href="http://www.blumenhabitus.ch/index.php?id=9";>direkt vor Ort!</a></p><p><b>Blumen f&uuml;r Firmen</b></p><p>Der Gesch&auml;fts / Arbeitsalltag soll auch ein Ort sein, an dem man sich gerne aufh&auml;lt. Gerne liefern und versch&ouml;nern wir (auch w&ouml;chentlich) Ihren Empfang, Ihren Firmenanlass. &Uuml;berraschen Sie doch Ihre Mitarbeiter mit einem speziellen Geburtstagsstrauss?</p><p><b>Trauerfloristik</b></p><p>Sie trauern um einen lieben Menschen. In einem verst&auml;ndnisvollen Gespr&auml;ch gehen wir auf Ihre W&uuml;nsche ein, um den Abschied floristisch passend zu umrahmen.</p><p><b>Geschenke</b></p><p>Geschmackvolle Accessoires, interessante Keramik- und Glasvariationen, Karten sowie Habitusgutscheine liebevoll ausgeschm&uuml;ckt erwarten Sie&nbsp;<a href="http://www.blumenhabitus.ch/index.php?id=28";>im Mitteldorf&nbsp;in Martel</a>!</p><p><b>Bestellungen</b></p><p>Gerne liefern wir zu Ihnen, Ihren Freunden und Bekannten nach Hause, oder Sie holen Ihre Bestellung <a href="http://www.blumenhabitus.ch/index.php?id=9";>bei uns&nbsp;im Habitus</a>&nbsp;ab.</p><p><!--EndFragment--></p><p><!--EndFragment--></p>',
