			context: "general",
			title: "Blumen Oase GmbH",
			subtitle: "Felsenrainstrasse 149A, 8052 Zürich",
			description:
				"<p><b>Herzlich Willkommen bei der Blumen Oase GmbH in Zürich-Seebach</b></p><p>Im November 2013 hat die Blumen Oase GmbH das Blumenatelier SUE in 8052 Z&uuml;rich-Seebach &uuml;bernommen. Die Blumen Oase GmbH besteht seit 1998 und kann mit dem Umzug nach Seebach&nbsp;nun auch verschiedene neue Gesch&auml;ftsbereiche anbieten.&nbsp;Gleichzeitig er&ouml;ffnete auch die oneITS&nbsp;gmbh in den Ladenlokalit&auml;ten der Blumen Oase GmbH einen Showromm f&uuml;r SONOS Multiroom-Musiksysteme. SONOS Systeme zeichnen sich durch eine unvergleichliche Soundqualit&auml;t sowie ein hervorragendes Preis/Leistungsverh&auml;ltnis aus. Die Kunden der Blumen Oase GmbH profitieren beim Einkaufen somit ausserdem von einer kristallklaren Hintergrundmusik, was die heimelige Atmosph&auml;re im Ladenlokal abrundet.<br /><br />Unser Personal ist mit Herzblut dabei und daher ist es bei uns eine Selbstverst&auml;ndlichkeit, dass alle Kunden sehr freundlich und kompetent beraten werden.<br /><br /><b>Produkte, Dienstleistungen</b><br />Unser Standard Floristikangebot:</p><ul><li>Blumen &amp; Pflanzen:&nbsp;Rosen, Blumengestecke, Str&auml;usse, Arrangements, Gestecke jeglicher Art, Pflanzen, Bepflanzungen</li><li>Hochzeitsfloristik: Brautstrauss, Beibrautstrauss, Kirchendekoration, Restaurantdekoration, Autodekoration,&nbsp;Anstecker, K&ouml;rperschmuck</li><li>Trauerfloristik: Kr&auml;nze jeglicher Art, Urnenherze, Kreuze, Grabkissen,</li><li>Eventfloristik: Dekorationen f&uuml;r Ihren Anlass&nbsp;von klein bis gross</li><li>Blumenabos: Wochendekoration f&uuml;r Empfang oder Eingangshallen, Jubil&auml;umsstr&auml;usse, Geburtstagsstr&auml;usse</li><li>Hauslieferdienst: Wir liefern Ihnen die bestellten Artikel zuverl&auml;ssig und termingerecht</li></ul><p><br /><b>Zus&auml;tzlich im Angebot:</b></p><ul><li>Multiroomsysteme: Verkauf von SONOS Multiroom-Komponenten, ab Lager erh&auml;ltlich</li><li>Accessoires: Edelstahl Stab-Weink&uuml;hler&nbsp; - Das ultimative Geschenk f&uuml;r die Einladung</li><li>Accessoires: Clack Eierk&ouml;pfer Jubil&auml;umsedition plus Eierbecher &ndash; Das ultimative Geschenk f&uuml;r die Bruncheinladung</li><li>Frische Eier vom Bauernhof: Frische Eier direkt vom eigenen Bauernhof f&uuml;r CHF 0.50 / Ei</li><li>Accessoires: Wir f&uuml;hren eine Vielzahl von Modeschmuck und&nbsp;Geschenkartikel jeglicher Art</li></ul><p>&nbsp;</p><ul><li>Das Ladenlokal der Blumen Oase GmbH + der SONOS-Showroom befinden sich in Z&uuml;rich-Seebach</li><li>Direkt neben dem Friedhof Schwandenholz</li><li>Es hat gen&uuml;gend Parkpl&auml;tze direkt vor dem Laden.</li></ul><p>&nbsp;</p>",
