			description:
				"<p><b>Willkommen auf der Blumen Ranch... Ort der Begegnung</b></p><p>Blumen &ndash; einfach sch&ouml;n!<br /><br />Mit Blumen k&ouml;nnen wir der Jahreszeit passende Akzente setzen und Farbe in Feiern, Treffen und den Alltag bringen. Wir k&ouml;nnen Gef&uuml;hle ausdr&uuml;cken und jemandem zeigen, wie sehr er uns am Herzen liegt. Menschen eine Freude zu bereiten gelingt uns am besten mit Blumen. Durch sch&ouml;ne Arrangements wird jeder Tisch zur Tafel. Bringen Sie Freude und Farbe auch auf Ihre Feier.<br /><br /><!--StartFragment-->Wir sind kreativ in den Bereichen:</p><ul><li>Hochzeitsfloristik</li><li>Trauerfloristik</li><li>spezielle Geschenkideen</li><li>Innenbegr&uuml;nungen</li><li>Festdekorationen</li><li>&nbsp;</li></ul><p>&nbsp;</p><p><b>Festdekoration</b></p><p><br />Feste bl&uuml;hen mit uns erst richtig auf.<br /><br />Einen Raum in einen Festsaal verwandeln, einen Tisch in eine Tafel, eine Feier in ein Fest.<br />Dies gelingt uns mit stilvollen Arrangements jahreszeitlicher Blumen. Immer anders, und immer wieder sch&ouml;n.<br /><br />Kontaktieren sie uns noch heute und wir besprechen mit ihnen die beste Dekoration f&uuml;r ihren Raum, ihren Anlass und ihren besonderen Tag.<br />&nbsp;</p><p><b>Innenbegr&uuml;nung</b></p><p><br />Vom simplen Raum zum stilvollen Wohn oder Arbeitsraum.<br />Unsere Gr&uuml;npflanzen in sorgf&auml;ltig ausgew&auml;hlten Gef&auml;ssen bringen eine wohnliche Atmosph&auml;re in ihre R&auml;ume.<br />Gerne kommen wir bei ihnen zu Hause vorbei und beraten sie pers&ouml;nlich in allen Fragen zur Innendekoration.</p><p>&nbsp;</p><p><b>Trauerfloristik</b></p><p><br />Eine w&uuml;rdevolle Abschiedsfeier, in Begleitung mit individuellen Blumenarrangements. Wir beraten sie gerne pers&ouml;nlich und gehen auf ihre besonderen W&uuml;nsche ein.<!--EndFragment--></p><p>&nbsp;</p><p>Kontaktieren Sie uns noch heute und wir besprechen mit Ihnen die beste Dekoration f&uuml;r Ihren Raum, ihren Anlass und ihren besonderen Tag.</p><p>&nbsp;</p>",
