				"https://www.local.ch/en/d/zuerich/8047/florist/blumenboutique-goos-_HZPe5C2MDTlSJ82cJk8XA",
			context: "general",
			title: "Blumenboutique Goos",
			subtitle: "Triemlistrasse 129, 8047 Zürich",
			description:
				"<p><b>Blumenboutique Goos, Zürich</b></p><p><b>HAUSLIEFERDIENST und GRATIS LIEFERUNG INS STADTSPITAL TRIEMLI</b></p><p>&nbsp;</p><p>Wilkommen bei Blumenboutique Goos.</p><p>Wir sind ein kleines, eingespieltes Team, mit langj&auml;hriger Berufserfahrung.</p><p>Seit &uuml;ber 20 Jahren sind wir stets daran interessiert, uns weiterzuentwickeln und unserer Kundschaft eine breite Palette an Qualit&auml;tsprodukten wie Schnittblumen, Pflanzen, Str&auml;usse und Gestecke zu offerieren.</p><p>Wir stellen alle unsere Qualit&auml;tsprodukte mit viel Freude und Fachwissen pers&ouml;nlich f&uuml;r Sie zusammen.</p><p>Fertigprodukte und Massenware gibt es bei uns nicht.</p><p>F&uuml;r Frische, Qualit&auml;t und Auswahl stehen wir mit unserem Namen.</p><p>&nbsp;</p><p><b>Schnittblumen:</b></p><p>Wir legen grossen Wert auf ein breites Rosen- und Schnittblumensortiment.</p><p>Die Natur bietet in jeder Jahreszeit wundersch&ouml;ne saisonale Schnittblumen.</p><p>Wir sind bem&uuml;ht, Ihnen diese grosse Auswahl an saisonalen Schnittblumen in der richtigen Jahreszeit anzubieten.</p><p><b>Str&auml;usse und Gestecke:</b></p><p>Schauen Sie uns &uuml;ber die Schultern, wenn wir Ihren pers&ouml;nlichen Blumenstrauss arrangieren oder suchen Sie sich einen bereits fertig gebundenen Strauss oder ein Gesteck aus.</p><p>Sie haben keine Zeit oder sind im Stress?</p><p>Kein Problem, bestellen Sie telefonisch Ihren Blumenstrauss und er steht zur gew&uuml;nschten Zeit zum Abholen f&uuml;r Sie bereit.</p><p><b>Pflanzen und Arrangements:</b></p><p>Unsere Pflanzen beziehen wir, wenn immer m&ouml;glich, von Schweizer G&auml;rtnereien. Sie finden bei uns immer eine grosse Auswahl an Orchideen, selber hergestellten Pflanzenarrangements, diverse Gr&uuml;npflanzen sowie bl&uuml;hende Pflanzen f&uuml;r den Innen- und Aussenbereich.</p><p><b>Trauerbinderei:</b></p><p>Ein traditioneller Kranz, Urnenkranz, ein Arrangement oder lieber ein Herz&hellip;</p><p>&hellip;wir stehen Ihnen auch in schweren Situationen mit viel Fachwissen, Verst&auml;ndnis und langj&auml;hriger Berufserfahrung bei.</p><p>Wir beraten Sie professionell &uuml;ber die M&ouml;glichkeiten und gehen gerne auf Ihre pers&ouml;nlichen W&uuml;nsche ein.</p><p><b>Hochzeitsfloristik:</b></p><p>Vom Brautstrauss und Anstecker &uuml;ber Kirchendekoration, Autodekoration bis hin zu Tischdekoration&hellip;wir bieten Ihnen alles f&uuml;r einen unvergesslichen Tag.</p><p>Wir freuen uns, auf Ihre Kontaktaufnahme oder Sie in unserem Blumengesch&auml;ft begr&uuml;ssen zu d&uuml;rfen.</p><p><!--StartFragment--></p><p><!--EndFragment--></p><p><!--EndFragment--></p>",
