			context: "general",
			title: "BlumenLaube GmbH",
			subtitle: "Hauptstrasse 27, 8259 Wagenhausen",
			description:
				"<p><b>Herzlich willkommen</b></p><p><!--StartFragment-->Ein junges und kreatives Team freut sich, Sie in der BlumenLaube zu begr&uuml;ssen. Kommen Sie vorbei, und lassen Sie sich von unserer Floristik verzaubern.<!--EndFragment--></p><p><!--StartFragment--></p><p>Unser Angebot</p><p><br />&bull; Schnittblumen<br />&bull; Blumenstr&auml;usse<br />&bull; Hochzeitfloristik<br />&bull; Trauerfloristik<br />&bull; Dauerabo&#39;s<br />&bull; Dekorationen und Firmenanl&auml;sse<br />&bull; Terrassengestaltung<br />&bull; Hauslieferdienst (in Stein am Rhein und Umgebung<br />&bull; und vieles mehr ...</p><p><!--EndFragment--><!--StartFragment--></p><p>Eventfloristik &ndash; Von der kleinen tafel bis zum grossen event</p><p>Mit Blumen schaffen Sie an Ihrem Anlass ein unvergessliches Ambiente. Ob Hochzeiten, Geburtstage, Taufen, private Feiern oder Firmenanl&auml;sse &ndash; gerne tragen wir dazu bei, dass Ihr Event ein voller Erfolg wird. Hochwertige Verarbeitung und Qualit&auml;t sind unser Bestreben.&nbsp;Bereits bei der Planung stehen wir Ihnen mit unserer Erfahrung und unserem Wissen zur Seite. Je nach Wunsch k&ouml;nnen Sie die florale Dekoration bei uns im Gesch&auml;ft abholen, oder wir &uuml;bernehmen f&uuml;r Sie im Sinn eines Rundum-Pakets auch die Auf-, Ab- und Umdekoration.&nbsp;Kommen Sie f&uuml;r ein erstes unverbindliches Gespr&auml;ch bei uns vorbei, oder kontaktieren Sie uns telefonisch oder per E-Mail.</p><p><!--EndFragment--></p>",
