			subtitle: "Ringstrasse 3, 6048 Horw",
			description:
				"<p><b>BLUMENGESCHÄFT   “BlütenTraum”   HORW</b></p><p><b>&ldquo;Die Sch&ouml;nheit der Bl&uuml;ten, liegt in den Augen des Betrachters&rdquo;</b></p><p>&ldquo;BL&Uuml;TENTRAUM&rdquo; das Blumenfachgesch&auml;ft in Horw, s&uuml;dlich von Luzern gelegen!<br />mit dem Slogan: &ldquo;<b>&hellip;wenn Sie das Besondere m&ouml;gen</b>&rdquo; fertigen wir Ihnen stets<br />besondere und &uuml;berraschende Werkst&uuml;cke an. Ob zum Verschenken oder um sich selber eine Freude zu bereiten, bei uns finden Sie stets etwas Besonderes!<br />Selbstverst&auml;ndlich bieten wir auch <b>Hochzeitsfloristik, stilvolle Dekorationen, sowie Trauerfloristik an.</b></p><p>Blumen sind auch das L&auml;cheln der Natur. Sie versch&ouml;nern unser Heim, schenken uns gute Laune, bringen Freude und dr&uuml;cken unsere Gef&uuml;hle auf ganz besondere Weise aus.<br />Mit Blumen verbinden wir verschiedene Emotionen und Erlebnisse. Dank und Freude, Gl&uuml;ck und Liebe, Trost und Gedenken.</p><p>Mit unseren saisonbezogenen Themenwelten sorgen wir f&uuml;r interessante Abwechslung in unserem Blumengesch&auml;ft.<br />Individuelle, phantasievolle Werkst&uuml;cke, hochstehende Floristik und &uuml;berraschende Geschenksideen dr&uuml;cken den Wandel der Jahreszeiten in floraler Sprache aus.</p><p><!--EndFragment--></p>",
