			subtitle: "Via Gismonda 3, 6850 Mendrisio",
			description:
				"<p><b>Della Santa Fiorista</b></p><p><b>Dal 1923</b> ci dedichiamo con passione all&#39;<b>evoluzione dell&#39;eleganza floreale</b>! Nel nostro negozio di 250m2 recentemente rinnovato e migliorato, potete trovare la pi&ugrave; grande scelta di fiori freschi, composizioni floreali,&nbsp;orchidee, piante verdi e fiorite, fiori di stoffa, composizioni con rose stabilizzate ed oggettistica. L&#39;ampia scelta che possiamo offrire alla nostra clientela &eacute; unica nel suo genere.</p><p>Grazie al nuovo<b> shop-online</b>, nel quale potete scegliere tra<b>&nbsp;oltre 250 creazioni floreali</b>, &eacute; possibile&nbsp;regalare direttamente da casa ai prezzi migliori il vostro omaggio floreale. &nbsp;Offriamo un <b>servizio rapido ed accurato</b>&nbsp;sempre&nbsp;attento all&#39;evoluzione di questa splendida professione.</p><p>Crediamo fermamente nella <b>visibilit&agrave; e trasparenza dei prezzi</b>, per questo grazie alle immagini dei nostri prodotti presenti nello&nbsp;shop-online, sapete esattamente cosa acquistate.</p><p>E se state organizzando il vostro <b>matrimonio </b>in Ticino....la nostra esperienza ci permette di seguirvi e consigliarvi anche nel vostro giorno pi&ugrave; bello. Contattateci per un appuntamento, discuteremo assieme e stileremo il preventivo pi&ugrave; adatto alle vostre esigenze.</p><p>Per maggiori informazioni visitate il nostro nuovo shop-online all&#39;indirizzo: <i><b>&nbsp;</b></i><b>www.fioristadellasanta.ch<;/b></p><p>&nbsp;</p>",
