			description:
				"<p><b>Fleuriste des Augustins</b></p><p><!--StartFragment--></p><p>1306/5000</p><p>We have at all times a wide choice of cut flowers, exotic flowers, varied bouquets, floral arrangements, arrangement of plants, plants green or flowered indoor or outdoor.<br /><br />For all your special occasions do not hesitate to contact us, or visit us at the shop.<br /><br />We realize for you:<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;Church decoration (wedding)<br />&nbsp;&nbsp;&nbsp;&nbsp;Wedding Bouquet<br />&nbsp;&nbsp;&nbsp;&nbsp;Car Decoration<br />&nbsp;&nbsp;&nbsp;&nbsp;Table and room decoration<br />&nbsp;&nbsp;&nbsp;&nbsp;Arrangements or special bouquets (birthdays, birth, and others as you wish)<br />&nbsp;&nbsp;&nbsp;&nbsp;Special Conferences for Mourning Ceremonies<br />&nbsp;&nbsp;&nbsp;&nbsp;Subscription service to receive weekly fresh flowers.<br /><br />An efficient delivery service is able to send your flowers throughout the Geneva region.<br /><br />Last tribute When a loved one is lost, there is more need than ever to be surrounded and all flowery messages are of the greatest moral comfort. The tribute to the deceased remains in our cultural traditions. It is necessary to adapt the colors according to the age and to reserve certain pieces according to the degree of kinship with the defunct person. The personalization of the flowered message is of great importance.<br /><br />Flower compositions<br /><br />The marriages<br /><br />Christmas decorations<br /><br />Hotels</p><p><!--EndFragment--></p>",
