			subtitle: "Mühlestrasse 1A, 8855 Wangen SZ",
			description:
				"<p><b>Herzlich Willkommen beim Blumenfachgeschäft Floriana Paradiso. </b></p><br>          Bei uns finden Sie aussergewöhnliche Blumenarrangements, stilvolle Pflanzen und auserlesene Accessoires. Besuchen Sie uns in unserer paradiesischer Atmosphäre.<br /><br /><strong>Schnittblumen, Sträusse und Gestecke<br /></strong>Täglich werden frische, saisonale Sträusse und Gestecke kreativ für die gestaltet. Selbstverständlich zaubern wir auf Wunsch jederzeit etwas Passendes nach Ihrem Geschmack.<br /><br /><strong>Hochzeit</strong><br />Damit Ihr schönster Tag unvergesslich wird, beraten wir Sie gerne persönlich. Den Brautsträussen, Blumenansteckern und Dekorationsmöglichkeiten in Kirchen sowie Restaurants sind keine Grenzen gesetzt.<br /><br /><strong>Trauer</strong><br />Einfühlsam und persönlich beraten wir Sie gerne in Trauerangelegenheiten.<br /><br /><strong>Spezielles</strong><br />Designkerzen, ausgarnierte Weinflaschen, originelle Geschenkverpackungen, Schaufensterdekorationen – keine Idee ist zu ausgefallen für uns. Gerne setzen wir Ihre Wünsche für Sie um.<br /><br /><strong>Blumen-Abonnement<br /></strong><br />Gerne stellen wir Ihnen unser Blumenabonnement vor:<br />&nbsp;<br />Wir liefern wöchentlich oder monatlich einem lieben Menschen, auf den Praxisempfangstisch oder in die Hotellobby einen Blumenstrauss oder ein Blumenarrangement – je nach Vorlieben.<br />Liefertermin, Preis und Blumenwünsche können abgesprochen und durch uns zuverlässig erfüllt werden.<br />Wenn wir Ihr Interesse geweckt haben, können Sie sich unverbindlich mit uns in Verbindung setzen. Gerne beraten wir Sie ausführlich.<br /></br>",
